import React from 'react';


const Article = ({ article }) => {
  return (
    <div className="">
      {article.urlToImage && (
        <img
          src={article.urlToImage}
          alt={article.title}
          className=""
        />
      )}
      <div className="">
        <h2 className="">{article.title}</h2>
        <p className="">{article.description}</p>
      </div>
      <a
        href={article.url}
        target="_blank"
        rel="noopener noreferrer"
        className=""
      >
        Read More
      </a>
    </div>
  );
};

export default Article;
